using System;
using System.Collections;
using UnityEngine;

namespace RetroSunset
{
    [RequireComponent(typeof(MeshFilter)), RequireComponent(typeof(MeshRenderer))]
    [ExecuteAlways]
    public class DynamicGrid : MonoBehaviour
    {
        [SerializeField]float sizeX;
        [SerializeField]float sizeY;
        [SerializeField][Range(0,1)]float heightScale;

        [SerializeField]int pointsX;
        [SerializeField]int pointsY;

        [SerializeField]int border = 0;

        [SerializeField]bool use32bitMesh;
        [SerializeField]bool maintainAspectRatio;
        [SerializeField]bool animate;

        Coroutine heightUpdate;
        
        Vector3[] vertices = null;
        int[] triangles = null;
        Vector2[] uv = null;

        Mesh mesh = null;
        
        bool invalid = false;
        
        public void SetHeightMap(int width, int height, ushort[] map, ushort unitsPerMeter)
        {
            if (unitsPerMeter == 0)
                throw new InvalidOperationException("Units Per Meter must be greater than zero");

            pointsX = width + border * 2;
            pointsY = height + border * 2;

            if (maintainAspectRatio)
            {
                if (pointsX > pointsY)
                    sizeY = (pointsY / (float)pointsX) * sizeX;
                else
                    sizeX = (pointsX / (float)pointsY) * sizeY;
            }

            // if (border > 0)
            // {
                var newMap = new ushort[pointsX * pointsY];

                for (var i = 0; i < pointsY; i++)
                {
                    for (var j = 0; j < pointsX; j++)
                    {
                        if (i - border < 0 || i - border >= height || j - border < 0 || j - border >= width)
                            newMap[i*pointsX + j] = 0;
                        else
                            newMap[i*pointsX + j] = map[(i - border)*width+(j-border)];
                    }
                }
                
                // map = newMap;
            // }

            
            if (heightUpdate != null)
                StopCoroutine(heightUpdate);

            heightUpdate = StartCoroutine(UpdateHeight(newMap, unitsPerMeter));
        }

        void Reset()
        {
            mesh = null;
            vertices = null;
            
            heightScale = 1;

            sizeX = 1;
            sizeY = 1;
            pointsX = 11;
            pointsY = 11;
        }

        void Start()
        {
            UpdateMesh();
        }

        // Update is called once per frame
        void Update()
        {
#if UNITY_EDITOR
            if (!Application.isPlaying)
                UpdateMesh();
#endif
        }

        void UpdateMesh(float[] heightMap = null)
        {
            if (!ValidateValues())
                return;

            if (mesh == null)
            {
                mesh = new Mesh();
                mesh.MarkDynamic();
                mesh.name = "Grid";

                GetComponent<MeshFilter>().mesh = mesh;
            }

            var totalVertices = pointsX * pointsY;
            var sizeChanged = !Equal(mesh.bounds, sizeX, sizeY);

            if (heightMap == null && vertices?.Length == totalVertices && !sizeChanged)
                return;

            var meshUpdated = invalid; // previously invalid - mesh was cleared.
            invalid = false;

            mesh.indexFormat = use32bitMesh ? UnityEngine.Rendering.IndexFormat.UInt32 :
                                              UnityEngine.Rendering.IndexFormat.UInt16;

            if (vertices?.Length != totalVertices)
            {
                vertices = new Vector3[totalVertices];
                uv = new Vector2[totalVertices];
                triangles = new int[(pointsX -1)*(pointsY-1)*6];

                meshUpdated = true;
                mesh.Clear();
            }

            var verticesUpdated = UpdateVertices(meshUpdated, heightMap);
            
            if (verticesUpdated)
            {
                mesh.vertices = vertices;
            
                if (meshUpdated)
                {
                    UpdateTriangles();
                    mesh.triangles = triangles;
                    mesh.uv = uv;
                }

                mesh.RecalculateNormals();
            
                if (sizeChanged)
                    mesh.RecalculateBounds();
            }
        }

        bool ValidateValues()
        {
            if (pointsX <= 1 || pointsY <= 1 || sizeX <= 0 || sizeY <= 0)
            {
                if (!invalid)
                {
                    invalid = true;
                    mesh.Clear(false);
                    Debug.LogError("Invalid dimensions");
                }
                return false;
            }

            if (!use32bitMesh && pointsX * pointsY > ushort.MaxValue)
            {
                if (!invalid)
                {
                    invalid = true;
                    mesh?.Clear(false);
                    Debug.LogError("16 bit mesh - vertex count must not exceed " + ushort.MaxValue);
                }
                return false;
            }

            return true;
        }

        bool UpdateVertices(bool meshUpdated, float[] heightMap)
        {
            var verticesUpdated = meshUpdated;

            var xStep = sizeX / (float)(pointsX - 1);
            var yStep = sizeY / (float)(pointsY - 1);

            var offsetX = sizeX / 2f;
            var offsetY = sizeY / 2f;

            if (heightMap != null && heightMap.Length != vertices.Length)
                heightMap = null;
                
            for (var j = 0; j < pointsY; j++)
            {
                var y = j * yStep - offsetY;

                for (var i = 0; i < pointsX; i++)
                {
                    var ix = j * pointsX + i;

                    var x = i * xStep - offsetX;
                    var h = heightMap == null ? 0 : heightMap[ix];
                    var v = new Vector3(x, h, y);

                    if (v != vertices[ix])
                    {
                        vertices[ix] = v;
                        verticesUpdated = true;
                    }
                    
                    if (meshUpdated)
                    {
                        uv[i].x = i / (float)pointsX;
                        uv[i].y = j / (float)pointsY;
                    }
                }
            }

            return verticesUpdated;
        }

        void UpdateTriangles()
        {
            for (int ti = 0, vi = 0, y = 0; y < pointsY - 1; y++, vi++)
            {
                for (int x = 0; x < pointsX - 1; x++, ti += 6, vi++)
                {
                    triangles[ti] = vi;
                    triangles[ti + 1] = triangles[ti + 4] = vi + pointsX;
                    triangles[ti + 2] = triangles[ti + 3] = vi + 1;
                    triangles[ti + 5] = vi + pointsX + 1;

                    // Debug.Log(vertices[vi].z + " " + triangles[ti] + ":" + triangles[ti + 1] + ":" + triangles[ti + 2] + " & " + triangles[ti + 3] + ":" + triangles[ti + 4] + ":" + triangles[ti + 5]);
                }
            }
        }

        IEnumerator UpdateHeight(ushort[] map, ushort unitsPerMeter)
        {
            var time = 0f;
            var heightAnimation = animate ? new AnimationCurve[map.Length] : null;
            var heights = new float[map.Length];

            for (var i = 0; i < map.Length; i++)
            {
                var height = (map[i]/(float)unitsPerMeter)*heightScale;
                
                if (animate)
                {
                    var oldheight = map.Length == vertices.Length ? vertices[i].y : 0;
                    heightAnimation[i] = AnimationCurve.EaseInOut(0f, oldheight, 0.5f, height);
                }
                else
                {
                    heights[i] = height;
                }
            }

            if (animate)
            {
                while (time < 0.5f)
                {
                    for (var i = 0; i < map.Length; i++)
                    {
                        heights[i] = heightAnimation[i].Evaluate(time); 
                    }

                    UpdateMesh(heights);
                    time += Time.deltaTime;
                    yield return null;
                }
            }
            else
            {
                UpdateMesh(heights);
            }
        }

        private static bool Equal(Bounds bounds, float width, float height)
        {
            return Mathf.Abs(bounds.size.x - width) < 0.001f &&
                   Mathf.Abs(bounds.size.z - height) < 0.001f;
        }

